// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Car {
    //子类可以访问非私有的属性
    uint public speed;
    //virtual， 说明该函数可以被重写
    function drive(uint _speed) public virtual {
        speed = _speed;
    }
}

contract ElectricCar is Car {
    uint public batteryLevel;
    //重写父类中的方法
    function drive(uint _speed) public override {
        super.drive(_speed);
    }
}

